package com.seluhadu.shchat.models;public abstract class BaseMessage {    private String userId;    private String receiverId;    private long messageId;    private long createdAt;    private long updatedAt;    private String msgType;    public String getMsgType() {        return msgType;    }    public void setReceiverId(String receiverId) {        this.receiverId = receiverId;    }    public void setMsgType(String msgType) {        this.msgType = msgType;    }    public String getUserId() {        return userId;    }    public void setUserId(String userId) {        this.userId = userId;    }    public String getReceiverId() {        return receiverId;    }    public void setReceveirId(String receiverId) {        this.receiverId = receiverId;    }    public long getMessageId() {        return messageId;    }    public void setMessageId(long messageId) {        this.messageId = messageId;    }    public long getCreatedAt() {        return createdAt;    }    public void setCreatedAt(long createdAt) {        this.createdAt = createdAt;    }    public long getUpdatedAt() {        return updatedAt;    }    public void setUpdatedAt(long updatedAt) {        this.updatedAt = updatedAt;    }}